import './App.css';
import Tree from './components/Tree';

function App() {
  return (
    <section className="columns">
    <Tree
      name="Live Oak"
      description="Doesn't lose its leaves" />
    <Tree
      name="Dogwood"
      description="Flowers in spring" />
    </section>
  );
}

export default App;
